package com.java.Easy_Level1;

public class Print_Integer {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		// declaring Variable
		int i;

		for (i = 1; i <= 10; i++) {
			System.out.println(i);
		}

		int c = 's';
		for (c = 1; c <= 5; c++) {
			System.out.println(c);
		}

		for (String a : args) {
			System.out.println(a);
		}

	}

}
